import MemberForm from "../components/forms/memberForm";
import SponsorForm from "../components/forms/sponsorForm";
import CommunityForm from "../components/forms/communityForm";
import { Nav } from "react-bootstrap";

export default function Contact() {
  return (
    <div>
      <h1>Contact</h1>
      {/*dynamic forms; depending on selection user will receive form with different call to action*/}
      <MemberForm />
      <SponsorForm />
      <CommunityForm />
      <Nav justify variant="tabs">
        <Nav.Item>
          <Nav.Link href="/home">Prospective Members</Nav.Link>
        </Nav.Item>
        <Nav.Item>
          <Nav.Link eventKey="link-1">Prospective Sponsors</Nav.Link>
        </Nav.Item>
        <Nav.Item>
          <Nav.Link eventKey="link-2">Community</Nav.Link>
        </Nav.Item>
      </Nav>
    </div>
  );
}
